        width: 100%;

      img {

        width: 31%;

      .bold {
        font-weight: 700;

      .capitalized {

        font-weight: 500;

      .full-height {

      .content, .couponContent, #lbCoupon > iframe {
        height: 100%;
        width: 100%;

      .content > .loadingContent, .content > .statusContent {
        background-color: #ffffff;
        height: 100%;
        position: absolute;
        width: 100%;
        z-index: 1;
        display: -webkit-box;
        display: flex;
        align-items: center;
        flex-direction: column;
        justify-content: center;
        -webkit-box-align: center;
        -webkit-box-direction: normal;
        -webkit-box-orient: vertical;
        -webkit-box-pack: center;

      .errorText {

      .errorText h1,h3 {
        text-align: center;
        font-size: 18px;
        font-weight: 500;
        letter-spacing: 1.2px;
        color: #000000;
        margin: 0;
      }

      .errorText h1 {
        margin-bottom: 3px;
